import React, { Component } from 'react';
import './App.css';
import Login from './Login.js';

class App extends Component {
  render() {
    return (
      <div className="App">
        <div className="App-header">
          <h1 className="bold">ReadingAid</h1>
        </div>
        <Login />
      </div>
    );
  }
}

export default App;
